insert into dbo.TreatmentBMP(TenantID, StormwaterJurisdictionID,TreatmentBMPTypeID, OwnerOrganizationID, TreatmentBMPName, LocationPoint, YearBuilt, Notes, RequiredFieldVisitsPerYear, TreatmentBMPLifespanTypeID, InventoryIsVerified, SystemOfRecordID)
select 2 as TenantID, 1 as StormwaterJurisdictionID, 35 as TreatmentBMPTypeID, 3 as OwnerOrganizationID, b.TreatmentBMPName, b.LocationPoint, b.YearBuilt, b.Notes, b.RequiredFieldVisitsPerYear, tblt.TreatmentBMPLifespanTypeID, 0 as InventoryIsVerified, b.SystemOfRecordID
from #TreatmentBMP b
left join dbo.TreatmentBMP tb on b.TreatmentBMPName = tb.TreatmentBMPName
left join dbo.TreatmentBMPLifespanType tblt on b.TreatmentBMPLifespanType = tblt.TreatmentBMPLifespanTypeDisplayName
where tb.TreatmentBMPID is null

